def expandPath(process, path, indent=''):
    indent += 2*" "
    for (kind, label) in getattr(process, path).directDependencies():
        if kind == "modules":
            print('{}[M] {} {}'.format(indent,getattr(process, label).__class__,label))
        elif kind == "sequences":
            print('{}[S] {}'.format(indent,label))
            expandPath(process, label, indent)
        elif kind == "conditionaltasks":
            print('{}[CT] {}'.format(indent,label))
            expandPath(process, label, indent)

